import logo from "./logo.svg";
import "./App.css";
import React from "react";
import Areas from "./Area_city/Area";
import Cities from "./Area_city/Citis";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      seleted_area_id: 0,
    };
  }

  render() {
    return (
      <div>
        <Areas
          onSlected={function (id) {
            console.log({ id });
            this.setState({ seleted_area_id: Number(id) });
          }.bind(this)}
        ></Areas>
      </div>
    );
  }
}

export default App;
